import { useEffect, useState } from 'react';
import "./Dashboard.css";
import Table from 'react-bootstrap/Table';
import axios from 'axios';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import FloatingLabel from 'react-bootstrap/FloatingLabel';
import Form from 'react-bootstrap/Form';

function Example() {
    const [show, setShow] = useState(false);
    const [count, setCount] = useState(0);
    const [product, setProduct] = useState([])

    useEffect(() => {
        getProduct();
    }, [])

    const getProduct = () => {
        axios.get('http://localhost:5002/notes')
            .then((res) => {
                setProduct(res.data.data);
                console.log(res.data.data);
            })
    }


    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);



    return (
        <>
            <Button variant="primary" className='btn-1' onClick={handleShow}>
                <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" className="bi bi-plus" viewBox="0 0 16 16">
                    <path d="M8 4a.5.5 0 0 1 .5.5v3h3a.5.5 0 0 1 0 1h-3v3a.5.5 0 0 1-1 0v-3h-3a.5.5 0 0 1 0-1h3v-3A.5.5 0 0 1 8 4" />
                </svg>
            </Button>

            <Modal show={show} onHide={handleClose}>
                <Modal.Header closeButton>
                    <Modal.Title>Add Product</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    <FloatingLabel controlId="floatingPassword" label="Product Name">
                        <Form.Control type="text" className="mb-3" />
                    </FloatingLabel>
                    <FloatingLabel controlId="floatingPassword" label="Variant">
                        <Form.Control type="text" className="mb-3" />
                    </FloatingLabel>
                    <FloatingLabel controlId="floatingPassword" label="Discription">
                        <Form.Control type="text" className="mb-3" />
                    </FloatingLabel>
                    <FloatingLabel controlId="floatingPassword" label="Price">
                        <Form.Control type="text" className="mb-3" />
                    </FloatingLabel>
                </Modal.Body>
                {/* <div className='btn-o'>
                    <h4 className='me-3'>Item</h4>
                    <Button variant="primary" onClick={handleClickMinus}>-</Button>{' '}
                    <h3 className='btn-2'>
                        {count}
                    </h3>
                    <Button variant="primary" onClick={handleClickPlus}>+</Button>{' '}
                </div> */}
                <Modal.Footer>
                    <Button variant="secondary" onClick={handleClose}>
                        Close
                    </Button>
                    <Button variant="primary" type='submit' onClick={handleClose}>
                        Save
                    </Button>
                </Modal.Footer>
            </Modal >


            <Table striped bordered hover>
                <thead>
                    <tr>
                        <th>#</th>
                        <th>First Name</th>
                        <th>Last Name</th>
                        <th>Username</th>
                    </tr>
                </thead>
                <tbody>
                    {product.map(item => (
                        <>
                            <tr>
                                <td>{item._id}</td>
                                {/* <td>{item.title}</td> */}
                                <td>Otto</td>
                                <td>@mdo</td>
                            </tr>
                            <tr>
                                <td>2</td>
                                <td>Jacob</td>
                                <td>Thornton</td>
                                <td>@fat</td>
                            </tr>
                            <tr>
                                <td>3</td>
                                <td colSpan={2}>Larry the Bird</td>
                                <td>@twitter</td>
                            </tr>


                        </>
                    ))}
                </tbody>
            </Table >
        </>
    );
}

export default Example;
